json = ActiveSupport::JSON.decode(File.read('db/seeds/postcode_boundaries_edited.json'))
puts "Inserting boundaries, please wait for up to 30 minutes depending on your json file size"
json['features'].each do |a|
  post_code_id = a['properties']['POA_2006']
  postcode = PostCode.find_by(poa_code: post_code_id)
  if postcode != nil
    if a['geometry']['type'] == 'MultiPolygon'
    	  for i in 0..a['geometry']['coordinates'].length-1
    	  	Polygon.create!(post_code_id: postcode.id)
    	  	polygon_id_new = Polygon.last(1)[0].id
  	  	  for j in 0..a['geometry']['coordinates'][i][0].length-1
  	  	   Coordinate.create!(polygon_id: polygon_id_new, longitude: a['geometry']['coordinates'][i][0][j][0].to_s, latitude: a['geometry']['coordinates'][i][0][j][1].to_s)
          end
        end
     # Polygon
    else
    	Polygon.create!(post_code_id: postcode.id)
    	polygon_id_new = Polygon.last(1)[0].id
    	for i in 0..a['geometry']['coordinates'][0].length-1
    		Coordinate.create!(polygon_id: polygon_id_new, longitude: a['geometry']['coordinates'][0][i][0].to_s, latitude: a['geometry']['coordinates'][0][i][1].to_s)
    	end
  	  
    end
  end

end 

